import React, { useState } from 'react';
import { Link } from 'react-router-dom';

function AuthorRegistration() {
  const [authorInfo, setAuthorInfo] = useState({
    name: '',
    institution: '',
    email: '',
    phone: '',
    researchInterests: '',
    // Add more fields as needed
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setAuthorInfo({
      ...authorInfo,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission, e.g., send data to backend
    console.log('Submitted:', authorInfo);
    // Reset form fields
    setAuthorInfo({
      name: '',
      institution: '',
      email: '',
      phone: '',
      researchInterests: '',
      // Reset other fields as needed
    });
  };

  return (
    <div style={{ padding: '20px' }}>
      <div style={{ marginBottom: '20px' }}>
        <header style={{ display: 'flex', alignItems: 'center' }}>
          <Link to="/">
            <img src="https://patch.com/img/cdn/users/22848633/2015/10/raw/2015105617e0d11c033.png" alt="Logo" style={{ width: '50px', marginRight: '10px' }} />
          </Link>
          <p className="mb-0" style={{ fontFamily: "Liberation Mono, monospace", color: "#01428c", fontSize: "24px", fontWeight: "bold", marginLeft: "8px" }}> ScholarBase</p>
        </header>
      </div>
      <div>
      <p className="mb-0" style={{ fontFamily: "Liberation Mono, monospace", color: "#01428c", fontSize: "24px", fontWeight: "bold", marginLeft: "8px" }}>AuthorRegistration</p>
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="name">Name:</label>
            <input type="text" className="form-control" id="name" name="name" value={authorInfo.name} onChange={handleChange} style={{ width: '500px', marginBottom: '10px' }} />
          </div>
          <div className="form-group">
            <label htmlFor="institution">Institution:</label>
            <input type="text" className="form-control" id="institution" name="institution" value={authorInfo.institution} onChange={handleChange} style={{ width: '500px', marginBottom: '10px' }} />
          </div>
          <div className="form-group">
            <label htmlFor="email">Email:</label>
            <input type="email" className="form-control" id="email" name="email" value={authorInfo.email} onChange={handleChange} style={{ width: '500px', marginBottom: '10px' }} />
          </div>
          <div className="form-group">
            <label htmlFor="phone">Phone:</label>
            <input type="tel" className="form-control" id="phone" name="phone" value={authorInfo.phone} onChange={handleChange} style={{ width: '500px', marginBottom: '10px' }} />
          </div>
          <div className="form-group">
            <label htmlFor="researchInterests">Research Interests:</label>
            <textarea className="form-control" id="researchInterests" name="researchInterests" value={authorInfo.researchInterests} onChange={handleChange} style={{ width: '500px', marginBottom: '10px' }}></textarea>
          </div>
          {/* Add more input fields for other information */}
          <button type="submit" className="btn btn-primary">Register</button>
        </form>
      </div>
    </div>
  );
}

export default AuthorRegistration;
